'use client'

import { useState, useEffect } from 'react'
import { Tabs, TabsContent, TabsList, TabsTrigger } from "./ui/tabs"
import { Card, CardContent, CardDescription, CardHeader, CardTitle } from "./ui/card"
import { Button } from "./ui/button"
import { Car, Calendar, LogOut } from 'lucide-react'
import { Badge } from "./ui/badge"
import Navbar from './Navbar'
import { useToast } from "./ui/use-toast"
import {
  AlertDialog,
  AlertDialogAction,
  AlertDialogCancel,
  AlertDialogContent,
  AlertDialogDescription,
  AlertDialogFooter,
  AlertDialogHeader,
  AlertDialogTitle,
  AlertDialogTrigger,
} from "./ui/alert-dialog"

interface Booking {
  _id: string;
  status: string;
  totalPrice: number;
  car: {
    name: string;
    model: string;
  };
  startDate: string;
  endDate: string;
}

export default function ProfilePage() {
  const [bookings, setBookings] = useState<Booking[]>([]);
  const [loadingBookings, setLoadingBookings] = useState(true);
  const [fetchError, setFetchError] = useState<string | null>(null);
  const [cancellingBookingId, setCancellingBookingId] = useState<string | null>(null);
  const { toast } = useToast()

  const fetchBookings = async (token: string) => {
    try {
      const response = await fetch('http://localhost:5000/api/bookings', {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (!response.ok) {
        throw new Error(`Failed to fetch bookings: ${response.status}`);
      }

      const data: Booking[] = await response.json();
      setBookings(data);
    } catch (error) {
      const err = error as Error;
      setFetchError(err.message || "An unknown error occurred.");
    } finally {
      setLoadingBookings(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/'; // Redirect to home page
  };

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      fetchBookings(token);
    }
  }, []);

  const cancelBooking = async (bookingId: string) => {
    const token = localStorage.getItem('token');
    if (!token) {
      toast({
        title: "Authentication Error",
        description: "Please log in to cancel your booking.",
        variant: "destructive",
      });
      return;
    }

    setCancellingBookingId(bookingId);

    try {
      const response = await fetch(`http://localhost:5000/api/bookings/${bookingId}`, {
        method: 'DELETE',
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });

      if (response.ok) {
        setBookings(bookings.filter(booking => booking._id !== bookingId));
        toast({
          title: "Booking Cancelled",
          description: "Your booking has been successfully cancelled.",
        });
      } else {
        const data = await response.json();
        if (response.status === 403) {
          toast({
            title: "Cancellation Not Allowed",
            description: data.message || "You are not allowed to cancel this booking.",
            variant: "destructive",
          });
        } else if (response.status === 404) {
          toast({
            title: "Booking Not Found",
            description: "The booking you're trying to cancel doesn't exist.",
            variant: "destructive",
          });
        } else {
          toast({
            title: "Cancellation Failed",
            description: data.message || "An error occurred while cancelling the booking.",
            variant: "destructive",
          });
        }
      }
    } catch (err) {
      console.error('Error:', err);
      toast({
        title: "Network Error",
        description: "An error occurred while cancelling the booking. Please check your internet connection and try again.",
        variant: "destructive",
      });
    } finally {
      setCancellingBookingId(null);
    }
  };

  return (
    <div className="min-h-screen bg-gray-100">
      <Navbar />
      <div className="container mx-auto px-4 py-8">
        <h1 className="text-3xl font-bold mb-8">My Profile</h1>
        <Tabs defaultValue="bookings">
          <TabsList className="grid w-full grid-cols-2 mb-8">
            <TabsTrigger value="bookings" className="flex items-center">
              <Car className="mr-2 h-4 w-4" />
              Bookings
            </TabsTrigger>
            <TabsTrigger value="logout" className="flex items-center">
              <LogOut className="mr-2 h-4 w-4" />
              Logout
            </TabsTrigger>
          </TabsList>
          <TabsContent value="bookings">
            <Card>
              <CardHeader>
                <CardTitle>Your Bookings</CardTitle>
                <CardDescription>View and manage your car rental bookings.</CardDescription>
              </CardHeader>
              <CardContent>
                {loadingBookings ? (
                  <p>Loading bookings...</p>
                ) : fetchError ? (
                  <p className="text-red-500">Error: {fetchError}</p>
                ) : bookings.length > 0 ? (
                  bookings.map(booking => (
                    <div key={booking._id} className="mb-6 p-4 border rounded-lg">
                      <div className="flex justify-between items-center mb-2">
                        <h3 className="text-lg font-semibold">{booking.car.name} {booking.car.model}</h3>
                        <Badge>{booking.status}</Badge>
                      </div>
                      <div className="flex justify-between mb-2">
                        <span className="flex items-center">
                          <Calendar className="mr-2 h-4 w-4" />
                          {new Date(booking.startDate).toLocaleDateString()} - {new Date(booking.endDate).toLocaleDateString()}
                        </span>
                        <span className="font-semibold">
                          Total: ${booking.totalPrice.toFixed(2)}
                        </span>
                      </div>
                      {booking.status === 'booked' && (
                        <AlertDialog>
                          <AlertDialogTrigger asChild>
                            <Button variant="destructive" size="sm">
                              Cancel Booking
                            </Button>
                          </AlertDialogTrigger>
                          <AlertDialogContent>
                            <AlertDialogHeader>
                              <AlertDialogTitle>Are you sure you want to cancel this booking?</AlertDialogTitle>
                              <AlertDialogDescription>
                                This action cannot be undone. You may be subject to cancellation fees depending on the booking policy.
                              </AlertDialogDescription>
                            </AlertDialogHeader>
                            <AlertDialogFooter>
                              <AlertDialogCancel>No, keep my booking</AlertDialogCancel>
                              <AlertDialogAction
                                onClick={() => cancelBooking(booking._id)}
                                disabled={cancellingBookingId === booking._id}
                              >
                                {cancellingBookingId === booking._id ? 'Cancelling...' : 'Yes, cancel booking'}
                              </AlertDialogAction>
                            </AlertDialogFooter>
                          </AlertDialogContent>
                        </AlertDialog>
                      )}
                    </div>
                  ))
                ) : (
                  <p>No bookings found.</p>
                )}
              </CardContent>
            </Card>
          </TabsContent>

          <TabsContent value="logout">
            <Card>
              <CardHeader>
                <CardTitle>Logout</CardTitle>
                <CardDescription>Are you sure you want to log out?</CardDescription>
              </CardHeader>
              <CardContent>
                <Button onClick={handleLogout}>Confirm Logout</Button>
              </CardContent>
            </Card>
          </TabsContent>
        </Tabs>
      </div>
    </div>
  );
}
